import React from 'react';
import { Box, Flex, Link } from '@chakra-ui/react';

const Navbar = () => {
  return (
    <Box bg="gray.800" color="white" py={4} px={8} position="fixed" w="100%" zIndex="1000">
      <Flex justify="space-between" align="center">
        <Box fontWeight="bold">CodeContest</Box>
        <Flex>
          <Link href="#how-are-we" mx={2}>How Are We</Link>
          <Link href="#metrics" mx={2}>Metrics</Link>
          <Link href="#timeline" mx={2}>Timeline</Link>
          <Link href="#why-register" mx={2}>Why Register?</Link>
          <Link href="#past-sponsors" mx={2}>Past Sponsors</Link>
          <Link href="#contact" mx={2}>Contact</Link>
        </Flex>
      </Flex>
    </Box>
  );
};

export default Navbar;
